                        <button className="btn-blue-outline">Yes</button>
                        <button className="btn-blue-outline">No</button>
                    </div>
                    { lucky && <div className="lucky">
                        Well if that is the case, this is your lucky day! In
                        this website you have the superpower to{" "}
